import React from 'react';
import CoffeeCards from "./cards";
import { Grid } from "@material-ui/core";


const ContentCards = () => {


  return (

    <Grid container>
      <Grid item xs={12} sm={4}>
        <CoffeeCards />
      </Grid>
    </Grid>

  )
}

export default ContentCards;
